import React from 'react'
import img1 from "../images/103710.jpg"
import img2 from "../images/2225_854x480 - Copie.jpg"
import img3 from "../images/402866.jpg"
import img4 from "../images/497284.jpg"


function MyCarousel() {

   const lesImages = [
      {src: img1, alt: 'slide1'},
      {src: img2, alt: 'slide2'},
      {src: img3, alt: 'slide3'},
      {src: img4, alt: 'slide4'}
  ]


  return (
    <div>
      <i className='fas fa-chevron-rigth'>L</i>
   {lesImages.map((image, key) => (
          <img key={key} src={image.src} alt={image.alt} width="60%" height="60%"/>    
       ))}
    <i className='fas fa-chevron-left'>R</i>
    </div>
  )
}

export default MyCarousel
